'use strict';
var sounds = {
    prefix: 'data:audio/mp3;base64,',
    music: [
        "",
        "",
        "",
        "",
        "",
    ]
};

var oldPageYOffset;
var ended;

window.onload = function() {
    playSound();
}

function playSound() {
    /*sound on loading*/
    oldPageYOffset = 0;
    ended = true;
    window.onscroll = function() {
        if (window.pageYOffset != oldPageYOffset && ended) {
            oldPageYOffset = window.pageYOffset;
            scrolledPage();
        }
    }
    var soundIndex = Math.floor(Math.random() * 5);
    var scream = new Audio(sounds.prefix + sounds.music[soundIndex]);
    scream.play()
}

function scrolledPage() {
    /*moan on scrolling*/
    var prefix = "data:audio/mp3;base64,";
    var sound = '';
    var moan = new Audio(prefix + sound);
    moan.play();
    ended = false;
    moan.onended = function () {
        ended = true;
    }
}

